def create_block(start_idx, end_idx, shifts=[]):
    block = []
    start_idx -= 5
    end_idx -= 4
    for i in range(start_idx, end_idx):
        phase = []
        size = cores = 0
        cores += float(result[i][1])
        size += float(result[i][2])*int(result[i][1])
        for shift in shifts:
            cores += float(result[i+shift][1])
            size += float(result[i+shift][2])*int(result[i+shift][1])
        phase.append(round(cores/(len(shifts)+1)))
        phase.append(size)
        block.append(phase)
    return block

